import { BrowserRouter as Router, useParams } from "react-router-dom";

export default function MacbookAir() {
  let { id } = useParams();

  return (
    <div>
      <video
        src="https://www.apple.com/105/media/us/macbook-air/2020/e3fd8da8-1d68-4e62-886e-7982672a0499/anim/hero/large_2x.mp4"
        controls="true"
        width="100%"
        controls="controls"
        autoplay="true"
      />
      <h1>Macbook Air</h1>
    </div>
  );
}
